import Table from './Table.js';

function Tables()
{
    const table=[
        { table_number : 1 , table_status : "busy"},
        { table_number : 2 , table_status : "free"},
        { table_number : 3 , table_status : "busy"},
        { table_number : 4 , table_status : "busy"}
    ];
    return (
        <div className="Tables">
            <div className="Tables_heading">
                <h1>Tables</h1>
            </div>
            <div className="Tables_table">
                {
                    table.map((tab) => {
                        return (
                            <Table tabledata={tab}></Table>
                        )
                    })
                }
            </div>
            <div className="Tables_button">
            </div>
        </div>
    )
}

export default Tables;
